function searchForMatching(input, callback) {
    if (this.showsInitialCandidates) {
        this.showsInitialCandidates = false;
        if (this.initialCandidates.length)
            return callback(this.initialCandidates);
    }
    if (!input || input === "") callback([])
    var parts = input.split(" "),
        matchParts = parts.slice(1).compact().map(function(ea) { return new RegExp(ea, "i"); }),
        searchAgain = this.lastSearchInput !== parts[0];
        this.lastSearchInput = parts[0];
    this.doSearch(searchAgain, parts[0], matchParts, callback);
}
